import styles from './Logo.module.css'; 

class Logo extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }

    render() { 
        return ( 
            <figure>
                <img src="/images/owleague-square.png" className={this.props.size   } alt=""/>
            </figure>
         );
    }
}
 
export default Logo;
